// LoadPlansByPage performs eager loading of values by page. This is for a 1-M or N-M relationship.
func (s SupporterSlice) LoadPlansByPage(ctx context.Context, e boil.ContextExecutor, mods ...qm.QueryMod) error {
	return s.LoadPlansByPageEx(ctx, e, DefaultPageSize, mods...)
}
func (s SupporterSlice) LoadPlansByPageEx(ctx context.Context, e boil.ContextExecutor, pageSize int, mods ...qm.QueryMod) error {
	if len(s) == 0 {
		return nil
	}
	for _, chunk := range chunkSlice[*Supporter](s, pageSize) {
		if err := chunk[0].L.LoadPlans(ctx, e, false, &chunk, queryMods(mods)); err != nil {
			return err
		}
	}
	return nil
}

func (s SupporterSlice) GetLoadedPlans() PlanSlice {
	result := make(PlanSlice, 0, len(s)*2)
	for _, item := range s {
		if item.R == nil || item.R.Plans == nil {
			continue
		}
		result = append(result, item.R.Plans...)
	}
	return result
}

